import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card'
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import Avatar from '@material-ui/core/Avatar';
import Chip from '@material-ui/core/Chip';




const useStyles = makeStyles((theme) => ({
	base_skill: {
		marginTop: '3vh',
		marginBottom: '3vh',
		backgroundColor: '#F2F2F2',
	},
	text_title: {
		margin: theme.spacing(1.5),
		display: 'flex',
		flexDirection: 'column',
		flexWrap: 'nowrap',
		alignItems: 'center',
		justifyContent: 'space-evenly',
	},
	text_content: {
		margin: theme.spacing(1.5),
		display: 'flex',
		flexDirection: 'row',
		flexWrap: 'nowrap',
		alignItems: 'center',
		justifyContent: 'space-evenly',
	},	
}));

export default function Skills() {
	const classes = useStyles();

	return (
		<Card className={classes.base_skill}>
			<div className={classes.text_title}>
	            <Typography gutterBottom variant="h5">
					<strong>SKILLS</strong>
	            </Typography>			
			</div>

			<div className={classes.text_content}>
				<Chip avatar={<Avatar>:)</Avatar>} label="Front-End Development" />
				<Chip avatar={<Avatar>:)</Avatar>} label="Back-End Development" />
				<Chip avatar={<Avatar>:)</Avatar>} label="Restful API Design" />
				<Chip avatar={<Avatar>:)</Avatar>} label="Web Crawler" />
				<Chip avatar={<Avatar>:)</Avatar>} label="Pygame" />
			</div>
		</Card>
	);
}
